DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `user_name` varchar(64) DEFAULT NULL COMMENT '用户名',
  `user_pwd` varchar(64) DEFAULT NULL COMMENT '用户密码',
  `pwd_salt` varchar(16) DEFAULT NULL COMMENT '密码后缀',
  `user_status` int(11) DEFAULT '0' COMMENT '用户状态：0-正常，1-冻结，2-注销，3-过期',
  `expire_time` datetime DEFAULT NULL COMMENT '过期时间',
  `login_times` int(11) DEFAULT '0' COMMENT '登录次数',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登录时间',
  `last_login_ip` varchar(64) DEFAULT NULL COMMENT '最后登录IP',
  `last_failed_times` int(11) DEFAULT '0' COMMENT '登录失败次数',
  `login_failed_time` datetime DEFAULT NULL COMMENT '登录失败最后记录时间',
  `login_locked` int(11) DEFAULT '0' COMMENT '是否因登录失败次数超限被锁定：1-锁定，0-正常',
  `login_locked_time` datetime DEFAULT NULL COMMENT '登录失败超限锁定的时间',
  `update_pwd_time` datetime DEFAULT NULL COMMENT '最后修改密码时间',
  `safety_question` varchar(32) DEFAULT NULL COMMENT '安全问题',
  `safety_answer` varchar(64) DEFAULT NULL COMMENT '安全问题答案',
  `real_name` varchar(64) DEFAULT NULL COMMENT '真实姓名',
  `telephone` varchar(64) DEFAULT NULL COMMENT '联系电话',
  `mobile` varchar(64) DEFAULT NULL COMMENT '手机号码',
  `email` varchar(64) DEFAULT NULL COMMENT '邮箱地址',
  `qq` varchar(16) DEFAULT NULL COMMENT 'QQ号码',
  `operator_id` int(11) DEFAULT '0' COMMENT '操作员ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`user_id`),
  KEY `user_name` (`user_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户';

