INSERT INTO `dev_sensor_param` VALUES ('25', 'RS485协议数据', '485XYData', '', '如:01 06 00 01 00 17 98 04为十六进制 最长为10字节，里面已经含了地址码信息\n约定：01 06 00 01 00 17 98 04\n01—地址码，网页设计中，需要分开，单独提供485地址码的配置界面，然后再组装成一串数据，存放配置文件。需要确保通道号20-25之间，不能有地址码重复的，需要安顺序递增。\n06—功能号\n00 01－数据地址\n00 17—数据\n98 04—CRC校验', '0', '0', '1', '0', '0', '', null, '1', '0106000100179804', '1', '0', '0', '2016-06-06 09:14:04', null);
